--
-- Name: auto_grade_answer(uuid, uuid); Type: FUNCTION; Schema: public; Owner: ielts_admin
--

CREATE FUNCTION public.auto_grade_answer(p_question_id uuid, p_selected_option_id uuid) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_is_correct BOOLEAN;
BEGIN
    SELECT is_correct INTO v_is_correct
    FROM question_options
    WHERE id = p_selected_option_id AND question_id = p_question_id;
    
    RETURN COALESCE(v_is_correct, false);
END;
$$;


ALTER FUNCTION public.auto_grade_answer(p_question_id uuid, p_selected_option_id uuid) OWNER TO ielts_admin;

--
-- Name: calculate_band_score(character varying, integer, integer); Type: FUNCTION; Schema: public; Owner: ielts_admin
--

CREATE FUNCTION public.calculate_band_score(skill character varying, correct_answers integer, total_questions integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
    percentage DECIMAL(5,2);
BEGIN
    percentage := (correct_answers::DECIMAL / total_questions) * 100;
    
    -- Simplified band score calculation (adjust based on official IELTS scoring)
    IF skill = 'listening' THEN
        CASE
            WHEN correct_answers >= 37 THEN RETURN 9.0;
            WHEN correct_answers >= 35 THEN RETURN 8.5;
            WHEN correct_answers >= 32 THEN RETURN 8.0;
            WHEN correct_answers >= 30 THEN RETURN 7.5;
            WHEN correct_answers >= 26 THEN RETURN 7.0;
            WHEN correct_answers >= 23 THEN RETURN 6.5;
            WHEN correct_answers >= 18 THEN RETURN 6.0;
            WHEN correct_answers >= 16 THEN RETURN 5.5;
            WHEN correct_answers >= 13 THEN RETURN 5.0;
            ELSE RETURN 4.5;
        END CASE;
    ELSIF skill = 'reading' THEN
        CASE
            WHEN correct_answers >= 39 THEN RETURN 9.0;
            WHEN correct_answers >= 37 THEN RETURN 8.5;
            WHEN correct_answers >= 35 THEN RETURN 8.0;
            WHEN correct_answers >= 33 THEN RETURN 7.5;
            WHEN correct_answers >= 30 THEN RETURN 7.0;
            WHEN correct_answers >= 27 THEN RETURN 6.5;
            WHEN correct_answers >= 23 THEN RETURN 6.0;
            WHEN correct_answers >= 19 THEN RETURN 5.5;
            WHEN correct_answers >= 15 THEN RETURN 5.0;
            ELSE RETURN 4.5;
        END CASE;
    END IF;
    
    RETURN 5.0;
END;
$$;


ALTER FUNCTION public.calculate_band_score(skill character varying, correct_answers integer, total_questions integer) OWNER TO ielts_admin;

--
-- Name: update_exercise_statistics(); Type: FUNCTION; Schema: public; Owner: ielts_admin
--

CREATE FUNCTION public.update_exercise_statistics() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF NEW.status = 'completed' AND OLD.status != 'completed' THEN
        -- Update exercise stats
        UPDATE exercises
        SET total_attempts = total_attempts + 1,
            average_score = (
                SELECT AVG(score)
                FROM user_exercise_attempts
                WHERE exercise_id = NEW.exercise_id AND status = 'completed'
            ),
            average_completion_time = (
                SELECT AVG(time_spent_seconds) / 60
                FROM user_exercise_attempts
                WHERE exercise_id = NEW.exercise_id AND status = 'completed'
            )
        WHERE id = NEW.exercise_id;
    END IF;
    
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.update_exercise_statistics() OWNER TO ielts_admin;

